import React, { Component } from 'react'
import { gql } from '@apollo/client'
import { data } from 'autoprefixer'
import Prodcut from './product'
import classes from './cart.module.css';

const selectedProduct = gql `
query {
  product (id:"huarache-x-stussy-le") {
    name
    brand
    description
    gallery

  }
}
`

const Cart = () => {
  return (
    <><div className={classes.data.product}></div>
    <h1 className={classes.data.product.name}>{Prodcut.name}</h1>

    <h1 className={classes.data.sectionHeading}>Size</h1>
    <div>
      <text className={classes.selectedProduct.productSize}>XS</text>
      <text className={classes.selectedProduct.productSize}>S</text>
      <text className={classes.selectedProduct.productSize}>M</text>
      <text className={classes.selectedProduct.productSize}>L</text>

    </div>

    </>


  )
}

export default Cart
